import React from 'react';
import logo from './logo.jpg';
import './App.css';



function App() {
  return (
    <React.Fragment>


      <div className='container-fluid body-cont' style = {{paddingTop : 5, paddingBottom : 15 }}>
        <main>
          <div className='container'>
            <button type='button' className='btn btn-outline-primary my-3'>
              Catalogue
                    <i className='fa fa-chevron-right' >
              </i>
            </button>
          </div>

        </main>
      </div>
    </React.Fragment>
  );
}

export default App;
